function scorePassword(t){var r=0;if(!t||t.length<8)return r;for(var n=new Object,o=0;o<t.length;o++)n[t[o]]=(n[t[o]]||0)+1,r+=5/n[t[o]];var e={digits:/\d/.test(t),lower:/[a-z]/.test(t),upper:/[A-Z]/.test(t),nonWords:/\W/.test(t)};for(var a in variationCount=0,e)variationCount+=1==e[a]?1:0;return r+=10*(variationCount-1),parseInt(r)}function checkPassStrength(t){var r=scorePassword(t);return r>80?"strong":r>60?"good":r>=30?"weak":r<30?"fail":""}